import React from 'react';
import Header from './components/header';
import Hero from './components/hero';
import Work from './components/work';
import './App.scss';

class App extends React.Component {

  render(){
  	return (
    <div className="App">
      {<Header />}
      {<Hero />}
      {<Work />}
    </div>
  );
  }
}

export default App;
